    true,nt"url": null,nt"notes": "Modeled Bouger Gravity data was extracted
    from the Pan American Center for Earth and Environmental Studies Gravity Database
    of the U.S. at http://irpsrvgis08.utep.edu/viewers/Flex/GravityMagnetic/GravityMagnetic_CyberShare/
    on 2/29/2012. The downloaded text file was opened in an Excel spreadsheet. This
    spreadsheet data was then converted into an ESRI point shapefile in UTM Zone 13
    NAD27 projection, showing location and gravity (in milligals). This data was then
    converted to grid and then contoured using ESRI Spatial Analyst.nnThis dataset contains
